import React from 'react';
import { settings } from 'config/C4';
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome';
import { faGithub, faLinkedin, faBehanceSquare, faDribbble } from '@fortawesome/free-brands-svg-icons';






const SocialIcons = () => {
  const { socials } = settings;

  let icon;
  if (socials.icon === 'github') {
    icon = <FontAwesomeIcon icon={faGithub} />
  } else if (socials.icon === 'linkedin') {
    icon = <FontAwesomeIcon icon={faLinkedin} />
  } else if (socials.icon === 'behance') {
    icon = <FontAwesomeIcon icon={faBehanceSquare} />
  } else if (socials.icon === 'dribbble') {
    icon = <FontAwesomeIcon icon={faDribbble} />
  }

  return (
    <div className="socialIcons">
      {socials && socials.filter(s => s.show).map((item, index) => (
        <a 
          key={index}
          href={item.url}
          target="_blank"
          rel="noreferrer noopener"
          className="socialIcons__icon"
        >
          {icon}
        </a>
      ))}
    </div>
  )
}

export default SocialIcons;
